import "./App.css";
import { Sidebar } from "./components/Sidebar";
import { Header } from "./components/Header";

function App() {
  return (
    <div className="App flex text-gray-600">
      <div className="w-1/6">
        <Sidebar />
      </div>
      <div>
        <Header />
      </div>
    </div>
  );
}

export default App;
